window.bookSummaryJSON = "<p><b>She's the pawn in his dangerous game of revenge.</b></p> <p>He arrives all dressed in black. Diamond cufflinks. A watch on his tanned wrist that cost more than we would ever see in a lifetime of work. He carries a single red rose....</p> <p>It turns out he is my new guardian.</p> <p>I should have known from the very start that he had more in common with the thorns than the rose. Now I know the truth: I’m a pawn in his dangerous game of revenge. I was too young and naïve. Now it's too late to save myself from his clutches.</p>"; 
